window.bookSummaryJSON = "<p><b>Four ridiculously silly stories with Henry, Lassie, Murdock, and some surprise guests!</b></p> <p><b>“Fun at the Vet”</b></p> <p>For his dad’s sixty-fifth birthday, Henry sends his dad to Las Vegas, leaving Henry to take care of his 160-pound dog Murdock. When Lassie and Murdock’s game of “What Won’t Murdock eat?” goes horribly wrong, a trip to the emergency vet is in order. And when a crazed snake owner takes the vet hostage, it’s up to Henry, Lassie, and Murdock to save the day. But they only have one hour. And the clock is ticking …</p> <p><b>“The Break-In”</b></p> <p>One of the gangs’ new friends has gone missing, and it’s up to Henry, Lassie, Murdock, and Henry’s father to rescue him. Before it’s too late …</p> <p><b>“A Very Lassie Christmas”</b></p> <p>After pulling some strings, Henry’s fiancée is able to surprise him with an early Christmas present: a 3:00 a.m. trip to the Smithsonian’s National Zoo. But when Lassie and Murdock tag along, everything goes haywire …</p> <p>“<b>The Bachelor Party”</b></p> <p>Just a few weeks before his wedding, Henry is shocked when he wakes up at the MGM National Harbor for a surprise bachelor party. And if Henry’s father, Lassie, and Murdock have anything to say about it, it will be an “hour” that Henry will never forget … even if he wants to …</p>"; 
